import React, { useState } from 'react';
import './Form.css'; // Optional: Add a CSS file for styling

const RegistrationForm = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    username: '',
    password: '',
    confirmPassword: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Perform registration logic here
    console.log('Form submitted:', formData);
  };

  return (
    <div className="registration-container">
      <h1>Fundo</h1>
      <h2>Create your Fundo Account</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>
            First Name*
            <input 
              type="text" 
              name="firstName" 
              required 
              value={formData.firstName} 
              onChange={handleChange} 
            />
          </label>
        </div>
        <div>
          <label>
            Last Name*
            <input 
              type="text" 
              name="lastName" 
              required 
              value={formData.lastName} 
              onChange={handleChange} 
            />
          </label>
        </div>
        <div>
          <label>
            Username*
            <input 
              type="text" 
              name="username" 
              required 
              value={formData.username} 
              onChange={handleChange} 
            />
            <small>You can use letters, numbers & periods</small>
          </label>
        </div>
        <div>
          <label>
            Password*
            <input 
              type="password" 
              name="password" 
              required 
              value={formData.password} 
              onChange={handleChange} 
            />
            <small>Use 8 or more characters with a mix of letters, numbers & symbols</small>
          </label>
        </div>
        <div>
          <label>
            Confirm*
            <input 
              type="password" 
              name="confirmPassword" 
              required 
              value={formData.confirmPassword} 
              onChange={handleChange} 
            />
          </label>
        </div>
        <button type="submit">Register</button>
      </form>
      <div>
        <p>
          <a href="#">Sign in instead</a>
        </p>
      </div>
      <footer>
        <p>English (United States)</p>
      </footer>
    </div>
  );
};

export default RegistrationForm;
